import React from 'react';
import AnchorLink from "react-anchor-link-smooth-scroll";
import './employee.css';

function Employee() {
    return (
        <div className="employee-pane">
          <h1 className='employee-label'>Employee Information</h1>
            <h2 align="center"/>
                <AnchorLink href="#general">
                    <button>General</button>
                </AnchorLink>

                <AnchorLink href="#job">
                    <button>Jon</button>
                </AnchorLink>

                <AnchorLink href="#pay">
                    <button>Pay</button>
                </AnchorLink>

                <AnchorLink href="#schedule">
                    <button>Schedule</button>
                </AnchorLink>

      </div>
      );
}



export default Employee;
